R["fx__na__@cyberdiva__28"]="{['TS']=1637960446,['Version']=1766,['Effects']={[1]={['SizeY']=60,['Roll']=0,['Contrast']=4,['MetaData']={['message']='Though later exposed as frauds, the\\nFox Sisters of New York helped to \\nbegin the modern Spiritualist\\nmovement in 1848.\\n\\nThank you for starting this modern\\nrevolution that opened so many eyes.',},['Z']=39245.638007,['SizeZ']=60,['SizeX']=320,['X']=37972.475964,['Y']=26344,['Id']=1003,['Alpha']=1,['Pitch']=4.712564,['Color']=999998,['EffectType']=4405,['Yaw']=4.480260,['Groups']=0,},[2]={['SizeY']=162,['Roll']=0,['Contrast']=4,['MetaData']={['message']='I am thankful for the Occult Movements\\nof the 1800s and 1900s. Without these \\nmovements Paganism and Spiritualism \\ntoday would not be so widely accepted, \\nand its practitioners would still be \\nfully persecuted across the world.\\n\\nWithin this labyrinth there are seven \\nalcoves that you should pay a visit to.\\n\\nThank you to my other half for introducing\\nme to so many new things in this world.',},['Z']=39251.222171,['SizeZ']=162,['SizeX']=380,['X']=37352.022276,['Y']=26337,['Id']=1004,['Alpha']=1,['Pitch']=4.712564,['Color']=999998,['EffectType']=4405,['Yaw']=4.480260,['Groups']=0,},[3]={['SizeY']=80,['Roll']=0,['Contrast']=4,['MetaData']={['message']='Modern Spiritualism arrived in Britain \\nin 1852 when an American woman \\nnamed Maria B. Hayden offered her \\nservices as a Medium.\\n\\nThank you for helping to spread the \\nmovement beyond America\\'s borders.',},['Z']=40838.634519,['SizeZ']=80,['SizeX']=180,['X']=37815.790276,['Y']=26345,['Id']=1005,['Alpha']=1,['Pitch']=4.799655,['Color']=999998,['EffectType']=4405,['Yaw']=6.051057,['Groups']=0,},[4]={['SizeY']=60,['Roll']=0,['Contrast']=4,['MetaData']={['message']='The Hermetic Order of the Golden Dawn, begun in 1887,\\nwas a British secret society whose study of things \\nparanormal, occult, and metaphysical shaped the \\nmodern traditions of Pagan religions such as Wicca.\\n\\nThough it disbanded in 1903, its influence today is \\nundeniable. I give thanks for its influence, for \\nwithout it I would still be lost.',},['Z']=41087.091414,['SizeZ']=60,['SizeX']=340,['X']=38726.442775,['Y']=26528,['Id']=1006,['Alpha']=1,['Pitch']=0,['Color']=999998,['EffectType']=4405,['Yaw']=4.480260,['Groups']=0,},[5]={['SizeY']=120,['Roll']=0,['Contrast']=4,['MetaData']={['message']='The Labyrinth has been used by many faiths to represent a journey.\\nIt is an ancient symbol of wholeness, guiding its follower to the\\ntruths within and around oneself.\\n\\nIt was a long and painful labyrinth that I was captured within...\\nuntil one day my eyes finally opened. I never looked back.\\nThank you for helping me to see what I could not see.',},['Z']=40012.309297,['SizeZ']=120,['SizeX']=440,['X']=37013.339948,['Y']=27522,['Id']=1007,['Alpha']=1,['Pitch']=0,['Color']=999998,['EffectType']=4405,['Yaw']=2.560398,['Groups']=0,},[6]={['SizeY']=100,['Roll']=0,['Contrast']=4,['MetaData']={['message']='In 1951 the United Kingdom repealed its last\\nanti-Witchcraft laws. Thank you for allowing\\nyour citizens to openly embrace their beliefs.\\n\\nThe Witchcraft Suppression Act of 1957 is still\\nenforced in South Africa today, suppressing many\\npractices in Pagan religions.',},['Z']=38605.457565,['SizeZ']=100,['SizeX']=260,['X']=38103.814521,['Y']=26345,['Id']=1008,['Alpha']=1,['Pitch']=4.712564,['Color']=999998,['EffectType']=4405,['Yaw']=1.338668,['Groups']=0,},[7]={['SizeY']=100,['Roll']=0,['Contrast']=4,['MetaData']={['message']='Paganism is not just one religion, but instead\\na collection of many religions and spiritualism.\\nUnlike in Christianity and other organized religions,\\nthe practices of spiritualism and pagan beliefs are\\nnot often set in stone. Instead, many are catered \\nto the individual or a small group.\\n\\nI am thankful that I have found the beginning of my path.',},['Z']=37932.524726,['Yaw']=1.338668,['SizeX']=280,['X']=38094.020519,['Y']=26328,['SizeZ']=100,['Alpha']=1,['Pitch']=4.712564,['Color']=999998,['EffectType']=4405,['Id']=1009,['Groups']=0,},[8]={['SizeY']=100,['Roll']=0,['Contrast']=4,['MetaData']={['message']='THE CHARIOT\\n\\nA driving force to success with determination and focus.',},['Z']=39135.574626,['Yaw']=4.480260,['SizeX']=420,['X']=39830.895245,['Y']=21607,['Pitch']=0,['Alpha']=1,['SizeZ']=100,['Color']=999998,['EffectType']=4405,['Id']=1010,['Groups']=0,},[9]={['SizeY']=140,['Roll']=0,['Contrast']=4,['MetaData']={['message']='THE HANGED MAN\\n\\nA reminder that sometimes you must let go of\\nexpectations and be patient, for things will happen\\nwhen they are meant to and no sooner.',},['Z']=40371.280296,['Yaw']=4.480260,['SizeX']=380,['X']=39527.755092,['Y']=21433,['Pitch']=0,['Alpha']=1,['SizeZ']=140,['Color']=999998,['EffectType']=4405,['Id']=1011,['Groups']=0,},},}"
