R["fx__na__@lilredbird__14"]="{['Version']=1766,['Effects']={[1]={['Id']=1042,['Y']=12031,['MetaData']={['title']='Aunt Anela\\'s Bloodfroth Recipe',['message']='- Pour fresh blood into shallow pans and place in the cold cave till nearly congealed. Meanwhile, whip together a couple of chicken egg yolks and melted tallow.\\n\\n\\n- Using a sharp knife, slice the blood into chunks, then dice. This is why you let it congeal first - it\\'s impossible to dice fresh blood!\\n\\n\\n- Whip the blood slivers with the yolks and tallow, adding more tallow if needed to thin into a beverage. Add salt to taste.\\n\\n\\n- Set aside for a month to allow it to ferment.\\n\\n\\n\\n\\n\\n\\n\\nEmber Root Grotto Variations\\n-=-=-=--=-=-=-=-=-=-=-=-=-=-=-=-\\n\\nEggs - Giant Snake? Kwama? Harpy?\\n\\nTallow - Keep at a tepid temperature.\\n\\nSalt - Southern Valenwood.  Mire salt.  Inferior stock will ruin the batch!\\n\\nHoney - Everything is better with honey! MUST ADD!\\n\\nBlood - Stag?  Hare?  ',},['SizeZ']=36,['Color']=395863,['Contrast']=1,['Groups']=2,['Roll']=0,['Z']=49989,['EffectType']=8501,['X']=48845,['Yaw']=6.255300,['Pitch']=4.852000,['Alpha']=0.180000,['SizeY']=36,['SizeX']=27.456456,},[2]={['Id']=1043,['Y']=11705,['SizeZ']=1000,['Color']=94786,['Pitch']=0,['Groups']=0,['Roll']=0,['SizeY']=1000,['EffectType']=521,['X']=47428.519981,['Yaw']=4.712389,['Contrast']=1.120000,['Alpha']=0.880000,['Z']=51494.026875,['SizeX']=1000,},[3]={['Id']=1044,['Y']=12050,['SizeZ']=1800,['Color']=83999,['Pitch']=0,['Groups']=0,['Roll']=0,['SizeY']=1800,['EffectType']=6,['X']=47247.034161,['Yaw']=5.804965,['Contrast']=1,['Alpha']=0.360000,['Z']=51443.950818,['SizeX']=1560,},[4]={['Id']=1045,['Y']=11705,['SizeZ']=1000,['Color']=22399,['Pitch']=0,['Groups']=0,['Roll']=0,['SizeY']=1000,['EffectType']=521,['X']=47384.976770,['Yaw']=4.712389,['Contrast']=1.620000,['Alpha']=0.800000,['Z']=51530.137660,['SizeX']=1000,},[5]={['Id']=1046,['Y']=11585,['SizeZ']=34,['Color']=488299,['Pitch']=4.806637,[