'Groups']=0,['Contrast']=1.810000,},[150]={['SizeX']=273.137255,['Alpha']=1,['Roll']=0,['Yaw']=4.712389,['Color']=999999,['SizeZ']=22,['SizeY']=22,['Pitch']=0,['Z']=4228,['EffectType']=5064,['X']=43644,['Contrast']=1,['Groups']=0,['MetaData']={['message']='Who have the crows led in from the cold now, hmm? An adventurer? We\\'ve had so few visitors of late, what with the hunt of the last one... But enough of that! Welcome to the Foyer, dear!',['name']='Sister Gellenna',},['Y']=19283,['Id']=2712,},[151]={['SizeX']=500,['Y']=19505,['Yaw']=3.141593,['Roll']=0,['Color']=996949,['SizeY']=500,['Pitch']=0,['Z']=4271,['EffectType']=972,['X']=43635,['SizeZ']=500,['Id']=2715,['Alpha']=1,['Groups']=0,['Contrast']=1,},[152]={['SizeX']=26.456456,['Alpha']=1,['Roll']=0,['Yaw']=5.888741,['Color']=102439,['SizeZ']=30,['SizeY']=30,['Pitch']=4.799655,['Z']=4285.812390,['EffectType']=8502,['X']=43405.041936,['Contrast']=1,['Groups']=0,['MetaData']={['title']='A Note from the Author',['message']='Dear Essential Housing Community Guests, \\n\\nMy name is Agonisus, and I would like to take a few moments to personally welcome you to one of my humble housing abodes. \\n\\nI invest a great deal of time, creativity, crafting materials, gold and real-world money to build unique houses such as this one. It would be a shame for such art to go to waste. I invite you to explore but a glimpse of my imagination.\\n\\nMy intent was to create a fully immersive community role-playing venue in the form of magnificent hunting village in Hircine\\'s legendary realm of Oblivion; his personal Hunting Grounds. \\n\\nIt is from here his hounds stalk the deadliest prey ever to walk the face of Nirn, or the realms beyond.  High watch towers overlook the dark, forested landscape below and fortified camps afford noble hunters the ability to congregate, and engage in ritual worship in reverence to the Master of the Chase. \\n\\nA monolithic standing stonehenge communes the will of Lord Hircine, and through this circle of power, the worthy are bestowed his blessings. \\n\\nMany werewolf guilds have their own halls, but if your role-playing troupe seeks an immersive, lore friendly venue outside their normal stage, by all means - invite them here for session or two.  I will never moderate or disrupt your role-play activities. However. I take occasional breaks from the grind in this house, and if present, I may role-play if you happen to approach me in character.\\n\\nI wish you well in your adventures and hope to see you visit soon. Please sign the guest book to show your support for my work?\\n\\nRespectfully,\\n-Agonisus',},['Y']=19417,['Id']=2762,},[153]={['SizeX']=20,['Alpha']=1,['Roll']=0,['Yaw']=4.450590,['Color']=9999,['SizeZ']=22,['SizeY']=22,['Pitch']=0,['Z']=4286.043264,['EffectType']=872,['X']=43405.133444,['Contrast']=1,['Groups']=0,['MetaData']={['message']='A Note from the Author',},['Y']=19446,['Id']=2763,},[154]={['SizeX']=1000,['Y']=16078,['Yaw']=3.141593,['Roll']=0,['Color']=435999,['SizeY']=1000,['Pitch']=0,['Z']=6872.970837,['EffectType']=499,['X']=46598.158226,['SizeZ']=1000,['Id']=2790,['Alpha']=0.880000,['Groups']=0,['Contrast']=1,},[155]={['SizeX']=1000,['Y']=16478,['Yaw']=3.141593,['Roll']=0,['Color']=435999,['SizeY']=1000,['Pitch']=0,['Z']=6872.970837,['EffectType']=499,['X']=46598.158226,['SizeZ']=1000,['Id']=2791,['Alpha']=0.880000,['Groups']=0,['Contrast']=1,},[156]={['SizeX']=1000,['Y']=16878,['Yaw']=3.141593,['Roll']=0,['Color']=435999,['SizeY']=1000,['Pitch']=0,['Z']=6872.970837,['EffectType']=499,['X']=46598.158226,['SizeZ']=1000,['Id']=2792,['Alpha']=0.880000,['Groups']=0,['Contrast']=1,},[157]={['SizeX']=1850,['Y']=15582,['Yaw']=3.665191,['Roll']=0,['Color']=517399,['SizeY']=2100,['Pitch']=5.323254,['Z']=7110.594534,['EffectType']=460,['X']=46857.994325,['SizeZ']=2100,['Id']=2793,['Alpha']=0.320000,['Groups']=0,['Contrast']=0.170000,},[158]={['SizeX']=1250,['Y']=16182,['Yaw']=3.490659,['Roll']=0,['Color']=517399,['SizeY']=1500,['Pitch']=0.2617