R["oh__@agonisus"]="{['TS']=1633809596,['na']={[72]={['O']=18909,['C']=1.007000,['D']='A meticulously decorated open community role-playing venue set in the heart of Hermaeus-Mora\\'s Oblivion realm of Apocrypha.\\r I have invested a great deal of time, creativity, crafting materials, gold and real-world money to build unique houses such as this one.\\r I highly recommend that you walk (not run) around\\r all areas of the home and truly immerse yourself for the intended experience. Streamers are welcome! Please sign the guest book to show your support for my work!',['N']='The Athenaeum',},[61]={['O']=18909,['C']=1.007000,['D']='A meticulously decorated open community role-playing venue set in a tribal village located in the heart of Hircine\\'s Hunting Grounds.\\r I have invested a great deal of time, creativity, crafting materials, gold and real-world money to build unique houses such as this one.\\r I highly recommend that you walk (not run) around\\r all areas of the home and truly immerse yourself for the intended experience. Streamers are welcome! Please sign the guest book to show your support for my work!',['N']='The Bloodmoon Caern',},[66]={['O']=18909,['C']=1.001000,['D']='A very fun, addictive PvE melee focused training arena with interactive traps and *extra traps* to add to the difficulty. The goal is to eliminate the target dummy and survive in close quarter combat. There is also plenty of food, ale and seating for spectators! Please sign the guest book to show your support for my work!',['N']='The Circle of Blades',},},['Key']='oh__@agonisus',['Version']=1762,}"
