R["oh__@svart_815"]="{['Version']=1762,['eu']={[32]={['N']='Sensford\\'s FG',['O']=18818,['C']=1.041000,},[35]={['N']='Ancestral Tomb',['O']=18749,['C']=1.029000,},[36]={['N']='Streets of Belotte',['O']=18823,['C']=1.035000,['D']='Resort town on small island between Summerset and Auridon. Altmeri always rest here and sunbath on golden sand. And famous elven navals protects this area from maormers. ​After Queen\\'s Decree many travelers can aknow local culture and buy souvenirs.\\r\\nThis is head-canoned Belport from TES:Arena and can differ from LORE.\\r\\nOpen for RP!',},[70]={['N']='Khajiiti town',['O']=18749,['C']=1.041000,},[8]={['N']='\"Drunken fairy\" Tave',['O']=18823,['C']=1.007000,['D']='A small mahogany tavern in Summerset village north of Shimmerene. The tavern is located in a village, further away from the main road. Nobles rarely visit this location; pilgrims and hunters usually stay here. After the Queen’s decree, foreigners began to appear here and the local Altmer are not happy with them.\\r\\nOpen for RP!\\r\\n',},[10]={['N']='Boethia\\'s Shrine',['O']=18749,['C']=1.037000,},[11]={['N']='Eliseum Tharcyro',['O']=18749,['C']=1.021000,},[13]={['N']='Telvanni housepod',['O']=18411,},[15]={['N']='Hectalcharya Village',['O']=18903,['C']=1.041000,['D']='Once this village in Valenwood was founded by Altmeri miners. They excavated magic crystals but then Force of Nature drove them out. Soon bosmers settled in abandoned houses and protects the crystals, bacause they feed the Green with power.\\r\\nOpen for RP.',},[49]={['N']='Ald-Garlas-Hame',['O']=18638,},[18]={['N']='\"Stone Sword\" Tavern',['O']=18823,['C']=1.007000,['D']='\"Stone Sword\" tavern in Reich Gradkeep named like this for statue that stand on a square nearby. There is free of politics and welcome to foreighers, so any travelers can stay here and taste local beer.\\r\\nOpen for RP!',},[19]={['N']='Telvanni ?hambers',['O']=18411,},[20]={['N']='Telvanni house',['O']=18749,['C']=1.020000,},[23]={['N']='\"Ears and Paws\" Cafe',['O']=18749,['C']=1.007000,},[26]={['N']='Wasten-Veyond',['O']=18782,['C']=1.007000,},[59]={['N']='\"Wilin Fanac\" Club',['O']=18823,['C']=1.007000,['D']='“White Bird” in Altmeris. This is a club for nobles in Shimmerene that has been operating since 2E 480. Visitors can meet here, eat delicacies, play games, dance and walk in the garden.\\r\\nThere are some rules:\\r\\n-Observe the dress code, armor and weapons are not allowed;\\r\\n-Don’t quarrel and don’t fight on the club territory;\\r\\n-Don’t break the property of the club and don’t insult servants;\\r\\n-Lower castes, Apraxics and foreigners not welcomed here.\\r\\nOpen for RP if you have altmer char',},[17]={['N']='House in Gradkeep',['O']=18749,['C']=1.007000,},[62]={['N']='Telin Tharcyro',['O']=18925,['C']=1.017000,['D']='The elder castle north of Shimmerene on the cliffs near King\\'s Haven Pass. This castle was founded in Dawn Era for protecting Direnni\\'s lands from goblins and monsters. Altmeri House Tharcyro rules this castle and surrounding villages for ages and serves honesty to Kinhouse of Shimmerene.\\n(All content inside villa, you can also use outfit station in light place)',},[38]={['N']='Streets of Gradkeep',['O']=18823,['C']=1.041000,['D']='Breton town of Reich Gradkeep from TES:Arena and Daggerfall. It\\'s head-canoned and may differ from other players\\' views. \\r\\nOpen for RP! Have connection with \"Stone Sword\" tavern (Garnder House).',},},['TS']=1635152761,['Key']='oh__@svart_815',}"
