s, along with the distorted perspective, makes some of the objects appear to be falling or not steady. The odd angle of the far wall results in the furniture not aligning properly. \\n\\nThis distorted perspective was not a mistake, the room at the Yellow House really did have crooked walls. It was not rectangular, but trapezoid with an obtuse angle in the left corner of the front wall and an acute angle at the right.\\n\\nVan Gogh painted three versions of this painting, each with minor changes to details and color. ',['title']='The Bedroom by Van Gogh',},['Yaw']=3.577925,['Id']=1321,['Z']=29063,['Color']=436979,['Y']=20156,['EffectType']=8503,['SizeX']=26.456456,['SizeZ']=30,['X']=19874,['Roll']=0,},[4]={['Groups']=0,['Alpha']=0.300000,['Pitch']=0,['Contrast']=4,['SizeY']=323,['Yaw']=5.937610,['Id']=1323,['Z']=28153,['X']=20092,['Y']=20363,['EffectType']=114,['SizeX']=117,['Roll']=0,['SizeZ']=323,['Color']=999999,},[5]={['Groups']=0,['Alpha']=1,['Pitch']=0,['Contrast']=1,['SizeY']=456,['Yaw']=4.101524,['Id']=1324,['Z']=28330,['X']=19722,['Y']=20252,['EffectType']=492,['SizeX']=252,['Roll']=0,['SizeZ']=456,['Color']=997350,},},},[4]={['Version']='16.0.9',['World']='na',['HouseId']=77,['TS']=1610637368,['Effects']={[1]={['Groups']=0,['Alpha']=0.900000,['Pitch']=0,['Contrast']=1,['SizeY']=654,['Yaw']=5.560619,['Id']=1377,['Z']=24830,['Roll']=0,['Y']=13705,['EffectType']=5113,['SizeX']=454,['Color']=999999,['SizeZ']=654,['X']=24869,},[2]={['Groups']=0,['Alpha']=0.580000,['Pitch']=0,['Contrast']=0.660000,['SizeY']=100,['Yaw']=0.848230,['Id']=1381,['Z']=24484,['Roll']=0,['Y']=13315,['EffectType']=9,['SizeX']=100,['Color']=999643,['SizeZ']=100,['X']=24402,},[3]={['Groups']=0,['Alpha']=0.620000,['Pitch']=0,['Contrast']=1.080000,['SizeY']=81,['Yaw']=1.649336,['Id']=1388,['Z']=24959,['Roll']=0,['Y']=13329,['EffectType']=463,['SizeX']=81,['Color']=494421,['SizeZ']=81,['X']=24092,},[4]={['Groups']=0,['Alpha']=1,['Pitch']=4.712564,['Contrast']=1,['SizeY']=300,['Yaw']=3.991568,